import userpic from '../../assets/minilogo.png'
const UserCard = () => {
    return (
        <div>
            <img src="https://robohash.org/consecteturnobisdolores.bmp?size=50x50&set=set1" alt=""/>
            <p>User Name</p>
            <p>User Id</p>
            <p>User Followers</p>
        </div>

    )
}

export default UserCard;
